import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import FilteredList from './FilteredList'
import './App.css'

class App extends Component{
  constructor(props) {
    super(props);
    this.state = {
      options: [
        {id: "0", name:"Fresh Balsalm", cost:9, size:"1", season:"Winter", burntime:"2", pic: require('freshbalsalm.jpg')},
        {id: "1", name:"Flannel", cost:14, size:"3", season:"Winter", burntime:"4", pic: "flannel.jpg"},
        {id: "2", name:"Frosted Cranberry", cost:24, size:"3", season:"Winter", burntime:"5", pic: "frostedcranberry.jpg"},
        {id: "3", name:"Vanilla Bean", cost:12, size:"1", season:"Fall", burntime:"3", pic:"vanillabean.jpg"},
        {id: "4", name:"Pumpkin Clove", cost:14, size:"3", season:"Fall", burntime:"4", pic: "pumpkin.jpg"},
        {id: "5", name:"Sweater Weather", cost:24, size:"3", season:"Fall", burntime:"5", pic: "sweaterweather.jpg"},
        {id: "6", name:"Cactus Blossom", cost:9, size:"1", season:"Spring", burntime:"2", pic:"cactusblossom.jpg"},
        {id: "7", name:"Peach Bellini", cost:14, size:"3", season:"Spring", burntime:"4", pic:"peach.jpg"},
        {id: "8", name:"Perfect Peony", cost:24, size:"3", season:"Spring", burntime:"5", pic:"perfectpeony.jpg"},
        {id: "9", name:"Limoncello", cost:12, size:"1", season:"Summer", burntime:"3", pic:"limoncello.jpg"},
        {id: "10", name:"Pomegranate Lemonade", cost:14, size:"3", season:"Summer", burntime:"4", pic: "pom.jpg"},
        {id: "11", name:"Cucumber Melon", cost:24, size:"3", season:"Summer", burntime:"5", pic: "cucumber.jpg"}
      ]
    }
  }

  render(){
    return (
      <div className="App">
        <FilteredList list={this.state.options}/>
      </div>
    );
  }
}


export default App;
